social_posts.post_text:
Congratulations to @619iamlucha for his induction into the 2023 Hall Of Fame!  Rey changed the game for so many wrestlers, and especially performers like myself, who was always told “You’re too small. You’ll never make it.” Rey proved someone like me could make it. He’s been such an inspiration to me- from the moment I saw Rey vs Psychosis from Bash at the Beach ‘96, I tried to emulate even a fraction of his style into mine. 

@the305mvp one time said ‘if you hear someone saying bad things about Rey, they’re lying. 

When they say don’t meet your heroes, they’ll disappoint you, they didn’t mean Rey Mysterio. I am proud that I can call Rey an opponent in the ring (thanks again for the experience) and more importantly a friend for life.
